import './App.css';
import { BrowserRouter as Router, Route, Link } from "react-router-dom";
import Primera from './components/Primera';
import Segunda from './components/Segunda';
import Tercera from './components/Tercera';
import Cuarta from './components/Cuarta';
import Quinta from './components/Quinta';
import Sexta from './components/Sexta';
import Septima from './components/Septima';
import Octava from './components/Octava';
import Novena from './components/Novena';
import Navegacion from './components/Navegacion';

function App() {
  return (
      <Router>
          <Route path="/Primera" components={Primera}/>
          <Route path="/Segunda" components={Segunda}/>
          <Route path="/Cuarta" components={Cuarta}/>
          <Route path="/Quinta" components={Quinta}/>
          <Route path="/Sexta" components={Sexta}/>
          <Route path="/Septima" components={Septima}/>
          <Route path="/Octava" components={Octava}/>
          <Route path="/Novena" components={Novena}/>
          <Navegacion/>
      </Router>
  );
}

export default App;
